sys_variable_value.value:
(function execute(inputs, outputs) {
	var inputScope = inputs.flow_scope_sys_id;
    var newFlow = inputs.new_flow_sys_id;
    var catalogItem = inputs.catalog_item;
    var customerType = inputs.customer_type;
    var caseType = inputs.case_type;
    var isEscalated = inputs.is_escalated;
    var prior = inputs.priority;
    var connection = inputs.ms_connection;

    //Update the catalog item 
    sn_flow.FlowTemplates.updateFlowActions(newFlow,'1', 'template_catalog_item', catalogItem);

   //Update the customer Type 
    sn_flow.FlowTemplates.updateFlowActions(newFlow,'2', 'customer_type', customerType);

  //Update the caseType

    sn_flow.FlowTemplates.updateFlowActions(newFlow,'2', 'case_type', caseType);

  //Update the isEscalated 
    sn_flow.FlowTemplates.updateFlowActions(newFlow,'2', 'is_escalated', isEscalated);

  //Update the prior
    sn_flow.FlowTemplates.updateFlowActions(newFlow,'2', 'priority', prior);

    new global.FlowTemplatesHelper().activateConnection(connection);
})(inputs, outputs);

